import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [tours, setTours] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/tours/')
      .then(response => setTours(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h1>JourneyVista</h1>
      {tours.map(tour => (
        <div key={tour.id}>
          <h2>{tour.name}</h2>
          <p>{tour.guide}</p>
        </div>
      ))}
    </div>
  );
};

export default App;
